from math import sqrt


class Solution(object):
    max_l, max_r = 0, 0

    def isStringLengthModFeasible(self, n):
        # if n mod x where 1 < x < 101 is not 0, then there's no way
        for i in range(2, int(sqrt(n)) + 2):
            if n % i == 0:
                return True
        return False

    def repeatedSubstringPattern(self, s):
        # early optimizations
        n = len(s)
        if n <= 1:
            return False
        if s == s[0] * len(s):
            return True
        for i in range(n / 2, 0, -1):
            if n % i == 0:
                batches = n / i
                # print 'Trying from 0:', i, ' with batch: ', batches
                # print s, ' vs ', s[0: i] * batches
                if s == s[0: i] * batches:
                    # print 'Matches at index: ', i
                    return True

        return False

    def repeatedSubstringPatternKMP(self, s):
        # early optimizations
        if len(s) <= 1:
            return False
        if s == s[0] * len(s):
            return True

        if not self.isStringLengthModFeasible(len(s)):
            return False

        # Minor opt: maybe later count of all characters should be even, else false
        # now substr is of even length and mixed chars

        # maintain a window denoted by [l,r]. from r+1 to end, try matching, if fails, expand window
        # until window reaches r < n/2
        for r in range(1, len(s) / 2):
            # print'\nTrying window for {0} from [0 - {1}]'.format(s, r)
            if (self.isSubstringRepeatedTillEnd(s, r)):
                return True
        return False

    def isSubstringRepeatedTillEnd(self, s, r):
        """Return true if a substr denoted by [0-r] is repeated all across"""
        # max_l, max_r = 0, r + 1
        for iteration, batch in enumerate(range(r + 1, len(s), r + 1)):
            # Process next r characters from k against [0 - l]
            k = batch
            # print'\n\nBatch of size : ', r + 1, ' starting at index ', batch
            pointer_start = 0
            if iteration == 0:
                # if I have seen some character
                charsKnownToMatch = self.max_r - batch + 1
                # print('But I have already seen ', charsKnownToMatch,
                #       ' chars. Why repeat from 0', self.max_l, self.max_r, batch)
                pointer_start = charsKnownToMatch

            for i in range(pointer_start, r + 1):
                # print'Pointer now at ', i, ' and ', k + pointer_start
                if s[i] != s[k + pointer_start]:
                    # print('No match ',  s[0: i + 1],
                    #    s[batch: k + pointer_start + 1])
                    return False
                else:
                    self.max_l = max(self.max_l, i)
                    self.max_r = max(self.max_r, k + pointer_start)
                    # #print('Max matches ', max_l, max_r)
                    # print'Window matches so far for [0 - {0}] and [{1} - {2}] {3} vs {4}'.format(
                    # i, batch, k + pointer_start, s[0: i + 1], s[batch: k + pointer_start + 1]), self.max_l, self.max_r, batch
                    k += 1
            # pass
        # print'All windows match for index ending at ', batch
        return True


